    <script>
      CanvasRenderingContext2D.prototype.roundRect = function (x, y, w, h, r) {
        if (w < 2 * r) r = w / 2;
        if (h < 2 * r) r = h / 2;
        this.beginPath();
        this.moveTo(x + r, y);
        this.arcTo(x + w, y, x + w, y + h, r);
        this.arcTo(x + w, y + h, x, y + h, r);
        this.arcTo(x, y + h, x, y, r);
        this.arcTo(x, y, x + w, y, r);
        this.closePath();
        return this;
      };

      function topenumber(str) {
        var numbers = [
          /[0۰٠]/g,
          /[1۱١]/g,
          /[2۲٢]/g,
          /[3۳٣]/g,
          /[4۴٤]/g,
          /[5۵٥]/g,
          /[6۶٦]/g,
          /[7۷٧]/g,
          /[8۸٨]/g,
          /[9۹٩]/g,
        ];
        var persiannumbers = ['۰', '۱', '۲', '۳', '۴', '۵', '۶', '۷', '۸', '۹'];

        for (var i = 0; i < numbers.length; i++) {
          str = str.replace(numbers[i], persiannumbers[i]);
        }
        return str;
      }

      function numberWithCommas(x) {
        return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',');
      }

      function rendercanv(
        width,
        height,
        title,
        imagesrc,
        font,
        price,
        dtl,
        color
      ) {
        var jcnv = $(
          '<canvas dir="rtl" id="mycanv" width="' +
            width +
            '" height="' +
            height +
            '"></canvas>'
        );

        var cnv = jcnv[0];

        var ctx = cnv.getContext('2d');

        var w = cnv.width;
        var h = cnv.height;

        ctx.fillStyle = 'white';
        ctx.fillRect(0, 0, w, h);

        base_image = new Image();
        base_image.src = imagesrc;

        base_image.addEventListener('load', function () {
          ctx.drawImage(base_image, 0, h * 0.23, w * 0.5, w * 0.5);

          ctx.fillStyle = color;
          ctx.fillRect(0, 0, w, h * 0.05);

          // ctx.fillRect(0, 400, 250, 20);

          var priceback = {};
          priceback.width = w * 0.7;
          priceback.height = h * 0.12;
          priceback.top = h * 0.791;
          priceback.left = -priceback.height;
          ctx
            .roundRect(
              priceback.left,
              priceback.top,
              priceback.width,
              priceback.height,
              priceback.height
            )
            .fill(); //or .fill() for a filled rect

          ctx.fillStyle = 'white';

          var price_fontsize = priceback.width * 0.1;
          ctx.font = price_fontsize + 'px irans';
          var price_txt = topenumber(numberWithCommas(price) + '') + ' تومان';

          var price_width = ctx.measureText(price_txt).width;
          var price_height = ctx.measureText(price_txt).actualBoundingBoxAscent;

          ctx.fillText(
            price_txt,
            price_width / 2 +
              priceback.width / 2 +
              priceback.left +
              priceback.height / 2,
            priceback.top + priceback.height / 2 + price_height / 2
          );

          ctx.fillStyle = 'black';

          var title_fontsize = priceback.width * 0.3;
          ctx.font = title_fontsize + 'px irans';
          var title_width = ctx.measureText(title).width;
          var title_height = ctx.measureText(title).actualBoundingBoxAscent;

          while (title_width > w * 0.9) {
            title_fontsize = title_fontsize - 0.05;
            ctx.font = title_fontsize + 'px irans';
            title_width = ctx.measureText(title).width;
            title_height = ctx.measureText(price_txt).actualBoundingBoxAscent;
          }

          if (title_fontsize > w * 0.1) {
            title_fontsize = w * 0.1;
            ctx.font = title_fontsize + 'px irans';
            title_width = ctx.measureText(title).width;
            title_height = ctx.measureText(price_txt).actualBoundingBoxAscent;
          }

          ctx.fillText(
            title,
            (w - title_width) / 2 + title_width,
            title_height + h * 0.07
          );

          /*
      wdth = ctx.measureText(itm.text).width;
                    if (itm.left == "center") {
                        itm.left = (480 - wdth) / 2;
                    }

                    ctx.fillText(itm.text, itm.left, itm.top);

                    */

          var maxl = 0;
          var biggestline = '';
          dtl.forEach((l) => {
            if (l.length > maxl) {
              maxl = l.length;
              biggestline = l;
            }
          });

          var linefontsize = w * 0.04;

          do {
            linefontsize = linefontsize - 0.05;
            ctx.font = linefontsize + 'px irans';

            var lntxt = biggestline;
            var lineme = ctx.measureText(biggestline);
          } while (lineme.width > w / 2.5);

          var firstlinepos =
            h * 0.25 +
            lineme.actualBoundingBoxAscent +
            lineme.actualBoundingBoxAscent * 0.5;
          dtl.forEach((l) => {
            ctx.fillText(l, w - w * 0.06, firstlinepos);
            firstlinepos = firstlinepos + lineme.actualBoundingBoxAscent * 2.7;
          });
        });

        return cnv;
      }
    </script>
