    <script>
      hastg = [];

      
      hastg.push('#'+$("#tinytitle").val());
      hastg.push('#بروجرد');
      hastg.push('#فروشگاه بروجرد');
      hastg.push('#بهکیانا');

      xcolor = $('.colorpi', 0)[0].style.backgroundColor;

      function oonder() {
        const regex = /(#.*?)(?=#|$)/gs;

const xtags = [...$('#caption').val().matchAll(regex)];
var fidn = [];
var repl = [];
xtags.forEach((i) => {
  fidn.push(i[1].trim());
  repl.push(i[1].trim().replace(/\s+/, '_'));
});
console.log(fidn);
console.log(repl);
  var str = $('#caption').val();
for (var i = 0; i < fidn.length; i++) {
  str = str.replace(fidn[i], repl[i]);
}

$('#caption').val(str);
      }
      function make() {
        var x = rendercanv(
          720,
          720,
          $('#title').val(),
          $('#imagesrc').val(),
          'arial',
          $('#price').val(),
          $('#dlt').val().trim().split('\n'),
          xcolor
        );

        $('#pan').empty();
        $('#pan').append(x);

        var guid = $('#dlt').val();

        guid +=
          '\n\n' +
          'قیمت : ' +
          topenumber(numberWithCommas($('#price').val()) + '') +
          ' تومان';
        $('#caption').val(
          $('#title').val() + '\n\n' + guid + '\n\n\n' + hastg.join('\n')
        );

        oonder();

      }

      $('.colorpi').click(function () {
        xcolor = $(this)[0].style.backgroundColor;
        make();
      });
      $('.ren').keyup(function () {
        make();
      });

      $('#image').bind('paste', function (e) {
        const items = (e.clipboardData || e.originalEvent.clipboardData).items;

        for (const item of items) {
          if (item.type.indexOf('image') === 0) {
            blob = item.getAsFile();

            var URLObj = window.URL || window.webkitURL;
            var source = URLObj.createObjectURL(blob);
            $('#imagesrc').val(source);
            console.log(source);
            make();
          }
        }
      });

      make();

      $('#caption').keyup(function() {

        var startPos = $(this)[0].selectionStart;
        var endPos = $(this)[0].selectionEnd;

       var vl = $(this).val().replace(/٫/g,"#");

       $(this).val(vl);


       oonder();

       $(this)[0].selectionStart = startPos;
       $(this)[0].selectionEnd = endPos;
      });
    </script>
